'use strict';
VultronixApp.service('imageService', [function () {

  this.calculateSize = (height, width) => {
    const MAX_WIDTH      = 800;
    const MAX_HEIGHT     = 600;
    let   imageSizeArray = [];
    if (width > height) {
      if (width > MAX_WIDTH) {
        height *= MAX_WIDTH / width;
        width   = MAX_WIDTH;
      }
    } else {
      if (height > MAX_HEIGHT) {
        width *= MAX_HEIGHT / height;
        height = MAX_HEIGHT;
      }
    }
    imageSizeArray[0] = width;
    imageSizeArray[1] = height;
    return imageSizeArray;
  };

  this.getFiles = (imageType) => {
    // TODO: make this more dynamic
    if (imageType === 'profileImage') {
      return profileImageInput.files;
    }
    if (imageType === 'newAlbumImage') {
      return newAlbumImageInput.files;
    }
    if (imageType === 'newPhotoImage') {
      return newPhotoImageInput.files;
    }
    if (imageType === 'groupImage') {
      return groupImageInput.files;
    }
    if (imageType === 'coverImage') {
      return coverImageInput.files;
    }
    if (imageType === 'feedImage') {
      return feedImageInput.files;
    }
  };

  this.getReqSizes = (imageType, height, width) => {
    let arySizes           = [];
    let widthToHeightRatio = width / height;
    if (imageType === 'profileImage' || imageType === 'groupImage' || imageType === 'newAlbumImage') {
      arySizes[0] = 110;
      arySizes[1] = 110;
      return arySizes;
    }
    if (imageType === 'coverImage') {
      arySizes[0] = 800;
      arySizes[1] = 300;
      return arySizes;
    }
    if (imageType === 'feedImage' || imageType === 'newPhotoImage') {
      arySizes[0] = 600;
      arySizes[1] = 600 / widthToHeightRatio;
      return arySizes;
    }
  };

  this.deleteNewFeedImages = (newFeedImageQty) => {
    for (let j = 1; j <= newFeedImageQty; j++) {
      let element = document.getElementById('newStatusImage_' + j);
      element.parentNode.removeChild(element);
    }
    document.getElementById('articleId').value = '';
  };

  this.getVideoData = (videoUrl,newFeedMediaQty) => {
    let videoRegEx = [
      /^.*(youtu.be\/|v\/|u\/\w\/|embed\/|watch\?v=|\&v=)([^#\&\?]*).*/,
      /https?:\/\/(?:www\.)?vimeo.com\/(?:channels\/(?:\w+\/)?|groups\/([^\/]*)\/videos\/|album\/(\d+)\/video\/|)(\d+)(?:$|\/|\?)/,
      /^.+dailymotion.com\/((video|hub)\/([^_]+))?[^#]*(#video=([^_&]+))?/
    ];
    let videoType  = ['youtube','vimeo','dailymotion'];
    let aryVideo   = [];

    for(let i = 0; i < videoType.length; i++) {
      let match = false;
      match     = videoUrl.match(videoRegEx[i]);
      if (match) {
        aryVideo[0] = videoType[i];

        switch (aryVideo[0]) {
          case 'youtube':
            aryVideo[1] = match[2];
            aryVideo[2] = 'https://img.youtube.com/vi/' + match[2] + '/maxresdefault.jpg';
            break;
          case "vimeo": case"dailymotion":
            aryVideo[1] = match[0];
            aryVideo[2] = match[3];
            break;
        }

        let mediaClass = ' class="feedImageThumbnail"';
        let mediaIcon  = ' data-mediaIcon="fa fa-video-camera"';
        let mediaId    = ' id="newStatusImage_' + newFeedMediaQty + '"';
        let mediaSrc   = ' src="' + aryVideo[2] +'"';
        let mediaUrl   = ' data-mediaUrl="' + videoUrl + '"';
        let mediaType  = ' data-mediaType="video"';
        aryVideo[3]    = '<img' + mediaClass + mediaIcon + mediaId + mediaSrc + mediaUrl + mediaType + '>';
        aryVideo[4]    = 'newStatusImage_' + newFeedMediaQty;
        return aryVideo;
      }
    }
  };

  this.logo = () =>{
    let vLogo = "data:image/png;base64,";
    return vLogo;
  };

}]);
